import * as React from "react";
import * as Rx from "typeless/rx";
import uuid from "uuid";
import { useModule, createEpic, createReducer } from "typeless";
import { LauncherActions, LauncherState, MODULE } from "./interface";
import { Launcher } from "./components/Launcher";

//
// @ Epic
//
export const epic = createEpic(MODULE);

//
// @ State
//
export const initialState: LauncherState = {
  appList: [
    {
      id: "1",
      name: "App Store",
      path: "/Applications/App Store.app",
      icon: "data:image/png;base64,",
      shortcut: ""
    }
  ]
};

//
// @ Reducer
//
export const reducer = createReducer(initialState).on(
  LauncherActions.addItem,
  (state, payload) => {
    state.appList.push({
      id: uuid(),
      path: payload.path,
      name: payload.name,
      icon: payload.icon,
      shortcut: ""
    });
  }
);

//
// @ Entry Module
//
export const LauncherModule = () => {
  useModule({
    epic,
    reducer,
    reducerPath: ["launcher"]
  });

  return <Launcher />;
};

//
// @ Global State
//
declare module "typeless/types" {
  interface DefaultState {
    launcher: LauncherState;
  }
}

